cardboard man No.36

段ボール好きな世界の皆んな、こんにちは！
今日も僕の膝はぶっ壊れたままです。
昨日はジムに行って上半身の筋トレをしました。
物足りないのでプールに行ってジャクジーで膝をブクブクしたらとても気持ちが良かったです。
調子にのって長時間していたら、今日は膝の調子がものすごく悪いです。
やはり安静にしていないといけなかったようです・・・。
はい。
でも上半身は元気なので今日も元気にやっていきます。

本日、紹介するのはダンボール人間36号。
下から見上げた写真です。
いつもの真っ直ぐ立っているのと違って、少し体の軸をずらして表情をつけています。
下からの写真だとわかりやすいですね。
動きのあるポーズも面白いです。
でもあまりキメポーズだと、見た人の想像力をかき消してしまう気がするので、ほどほどのポーズも取り入れていこうかな。と思います。
今日も暑いです。
熱中症に気をつけましょう。

Dan Ball Human 36
 cardboard man No.36

 Cardboard favorite of the world everyone, Hello!
 My knees are still broken today.
 Yesterday, I went to the gym and did a workout on my upper body.
 I was unsatisfied so I went to the pool and blew my knees in the jacuzzi and it was very comfortable.
 If I was in good shape for a long time, today my knees are in bad shape.
 After all, it seems that he had to rest.
 Yes.
 But my upper body is fine, so I will continue to do well today.

 Today, I would like to introduce Cardboard Human No. 36.
 It is a photo looking up from below.
 Unlike the usual straight standing, the body axis is slightly offset to give the expression.
 It's easy to understand from the picture below.
 The pose with movement is also interesting.
 However, it seems that if you pose too much, it will drown out the imagination of the viewer, so I'd like to incorporate a moderate pose.  I think.
 It's hot today too.
 Let's be careful about heat stroke.

